    /**
     * Formata o nÃºmero de telefone para o padrÃ£o brasileiro
     *
     * @param string $phoneNumber
     * @return string|null
     */
    private function formatPhoneNumber(string $phoneNumber): ?string
    {
        $phoneNumber = preg_replace('/[^0-9]/', '', $phoneNumber);
        if (strlen($phoneNumber) > 10) {
            //  Remove o cÃ³digo do paÃ­s se presente
            if (substr($phoneNumber, 0, 2) === '55') {
                $phoneNumber = substr($phoneNumber, 2);
            }
            // Verifica se Ã© um nÃºmero de celular (11 dÃ­gitos)
            if (strlen($phoneNumber) == 11) {
                return '(' . substr($phoneNumber, 0, 2) . ') ' . substr($phoneNumber, 2, 5) . '-' . substr($phoneNumber, 7);
            }
        } elseif (strlen($phoneNumber) == 10) {
            // Se tiver 10 dÃ­gitos, Ã© um nÃºmero de telefone fixo
            return '(' . substr($phoneNumber, 0, 2) . ') ' . substr($phoneNumber, 2, 4) . '-' . substr($phoneNumber, 6);
        }
        return null;
    }
